        [Test]
        public void LavaPool_CanReradInput()
        {
            var lavaPool = new LavaPool(exampleInput1);

            lavaPool.Digs[0].Direction.Should().Be("R");
            lavaPool.Digs[0].Distance.Should().Be(6);
            lavaPool.Digs[0].Colour.Should().Be("70c710");
        }

